message:
[v2]Shared element transition android (#3632)

Implement Element transition on Android

This commit adds basic support for Element transition to Android.
Currently, only Shared Transition is supported and only when pushing screens.

There are a few caveats you need to be aware of if you intend to use
this feature in its current state:

1. Since elements need to be laid out before the transition can start, Set `waitForRender: true` when pushing the destination screen.
2. Fade animation has to be used when pushing screens with shared elements.

API

```js
options: {
  animations: {
    push: {
      waitForRender: true,
      content: {
        alpha: {
          from: 0,
          to: 1,
          duration: 250
        }
      }
    }
  },
  customTransition: {
    animations: [
    ]
  }
}
```

Allow to update props for a specific component (#5612)

This commit adds support to update props of screen or custom button/title via the mergeOptions api.

```js
Navigation.mergeOptions('myComponentId', {
  passProps: {
    text: 'new value'
  }
});
```

Support enter exit animations in stack layout (#6762)

This PR adds support for animating both appearing and disappearing screens (`content`) in stack transitions; push, pop and setStackRoot.

To maintain backwards compatibility, the existing API is still supported and when used will animate the appearing screen in the push and setStackRoot commands and the disappearing screen in pop command.

### New API
```js
options: {
  animations: {
    setStackRoot: {
      content: {
        enter: {},
        exit: {},
      },
      topBar: {
        enter: {},
        exit: {},      
      },
      bottomTabs: {
        enter: {},
        exit: {},      
      }
    },
    push: {
      content: {
        enter: {},
        exit: {},
      },
      topBar: {
        enter: {},
        exit: {},      
      },
      bottomTabs: {
        enter: {},
        exit: {},      
      }
    },
    pop: {
      content: {
        enter: {},
        exit: {},
      },
      topBar: {
        enter: {},
        exit: {},      
      },
      bottomTabs: {
        enter: {},
        exit: {},      
      }
    }
  }
}
```

### Additional changes
* Updated Robolectirc to v4.4 as I ran into some memory issues when running unit tests. I also increased the amount of memory available to the task running the unit tests. Still not sure whether the memory problems stem from an issue in RNN or in Robolectric.
* Unit tests now run in Paused mode by default. Events posted to the looper are cleared after each test.
* Converted a bunch of files to Kotlin
* Fixed warnings all over the place

related to #6060

